import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import './ResultPage.css';

const ResultPage = () => {
    const navigate = useNavigate();
    const location = useLocation();
    const { score, totalQuestions, userAnswers, correctAnswers } = location.state || {};

    if (!location.state) {
        return <div>No data available</div>;
    }

    const calculateRank = () => {
        // Placeholder for rank calculation logic
        return '1st'; // Replace with actual logic
    };

    return (
        <div className="result-page">
            <h2>Quiz Completed!</h2>
            <h3>Your Score: {score} / {totalQuestions}</h3>
            <h3>Your Rank: {calculateRank()}</h3>

            <h4>Performance Breakdown</h4>
            <ul className="performance-list">
                {Object.keys(correctAnswers).map((questionIndex, idx) => (
                    <li key={idx}>
                        <strong>Question {parseInt(questionIndex) + 1}:</strong> 
                        {correctAnswers[questionIndex].question}
                        <div>
                            <strong>Your Answer:</strong> {userAnswers[questionIndex] || "Not answered"} &nbsp;
                            <strong>Correct Answer:</strong> {correctAnswers[questionIndex].answer}
                        </div>
                        <div className={userAnswers[questionIndex] === correctAnswers[questionIndex].answer ? "correct" : "incorrect"}>
                            {userAnswers[questionIndex] === correctAnswers[questionIndex].answer ? "Correct" : "Incorrect"}
                        </div>
                    </li>
                ))}
            </ul>

            <div className="result-buttons">
                <button onClick={() => navigate('/dashboard')}>Back to Dashboard</button>
                <button onClick={() => navigate('/login')}>Log Out</button>
            </div>
        </div>
    );
};

export default ResultPage;
